// ==UserScript==
// @name         DI FM. FU. UPDATED  Don't bug me, Digitally Imported (Violentmonkey)
// @namespace    https://github.com/adelobosko/DI.FM
// @description  Closes the "Are you still there?" dialog box + Autoplay
// @include      https://www.di.fm/*
// @exclude      https://www.di.fm/login
// @grant        none
// @author       Alexey Delobosko (Rescripted the Jonathan Landrum)
// @version      1.0
// ==/UserScript==
/* jshint -W097 */
'use strict';

setInterval(function() {
    var modal = document.getElementById('modal-region');
    var playbutton = document.getElementsByClassName("ico icon-play");
    var playSound = false;
    if(playbutton.length > 0)
      {
        playSound = true;
        playbutton[0].click();
      }
    if (typeof(modal) !== 'undefined' && modal !== null && modal.children.length !== 0) {
        document.querySelectorAll("button[type='button']")[1].click();
      playSound = true;
    }
  
    if(playSound)
      {        
      var snd = new Audio("data:audio/wav;base64,");  
		snd.play();
      }
}, 1000);
